import './Tweet.css';

const action = (e) => {
    console.log(e.target.innerHTML);
}
const Tweet = (props) => {
    return(
        <div className="Tweet">
        <h1 onClick={(e) => action(e)}>{props.title}</h1>
        <p>{props.content}</p>
        <p>Likes : {props.likes}</p>
        </div>
    );
}

export default Tweet;
